insert into META_TRANSFER_ACTIONS (VERSION_NUMBER, TRANSFER_ACTION_ID, COLLECTION_ID, COLLECTION_SET_ID, ACTION_TYPE, TRANSFER_ACTION_NAME, ORDER_BY_NO, DESCRIPTION, WHERE_CLAUSE_01, ACTION_CONTENTS_01, ENABLED_FLAG, CONNECTION_ID, WHERE_CLAUSE_02, WHERE_CLAUSE_03, ACTION_CONTENTS_02, ACTION_CONTENTS_03) values ('((802))', 61003, 13629, 247, 'Aggregation', 'Aggregator_DC_E_MGW_ELEMBH_MONTHRANKBH_ELEM_CP2', 1, null, '#
#Thu Dec 17 11:09:11 GMT 2009
tablename=DC_E_MGW_ELEMBH_RANKBH
', '

set temporary option join_preference=''-1''


#foreach($table in $targetTableList.get("RANKBHCLASS"))

UPDATE $table.get("table") AS dst  
SET 
dst.monthbh = 0
WHERE dst.date_id between $dateid and dateadd(mm,1,$dateid)-1
and dst.bhtype=''ELEM_CP2'';

#end





SELECT 
b.ELEMENT_NAME AS ELEMENT_NAME, 
b.ELEMENT_TYPE AS ELEMENT_TYPE, 
b.MGW AS MGW, 
b.OSS_ID AS OSS_ID, 
b.bhtype AS bhtype,max(b.bhvalue) AS bhvalue, cast(null as date) AS date_id 
INTO #calculate_$targetTable.get("RANKBHCLASS") 
FROM $targetDerivedTable.get("RANKBHCLASS") as b 
where b.date_id between $dateid and dateadd(mm,1,$dateid)-1 
and b.bhtype = ''ELEM_CP2'' 
group by 
b.ELEMENT_NAME,
b.ELEMENT_TYPE,
b.MGW,
b.OSS_ID,
b.bhtype;

UPDATE #calculate_$targetTable.get("RANKBHCLASS") AS dst 
SET dst.date_id = a.date_id from $targetDerivedTable.get("RANKBHCLASS") as a
where a.date_id between $dateid and dateadd(mm,1,$dateid)-1 
and a.bhtype = dst.bhtype
and a.ELEMENT_NAME = dst.ELEMENT_NAME 
and a.ELEMENT_TYPE = dst.ELEMENT_TYPE 
and a.MGW = dst.MGW 
and a.OSS_ID = dst.OSS_ID 
and a.bhvalue = dst.bhvalue;


#foreach($table in $targetTableList.get("RANKBHCLASS"))

UPDATE $table.get("table") AS dst 
SET 
dst.monthbh = 1 
from #calculate_$targetTable.get("RANKBHCLASS") as a
where dst.date_id=a.date_id
and dst.ELEMENT_NAME= a.ELEMENT_NAME 
and dst.ELEMENT_TYPE= a.ELEMENT_TYPE 
and dst.MGW= a.MGW 
and dst.OSS_ID= a.OSS_ID 
and dst.bhvalue=a.bhvalue;

#end

drop table #calculate_$targetTable.get("RANKBHCLASS");


#foreach($table in $targetTableList.get("RANKBHCLASS"))

UPDATE $table.get("table") AS dst  
SET 
dst.bhclass = (dst.monthbh * 100) + (dst.weekbh * 10) + 1
WHERE dst.date_id between $dateid and dateadd(mm,1,$dateid)-1
and dst.bhtype=''ELEM_CP2'';

#end

set temporary option join_preference=''0''

', 'Y', 2, '', '', '', '');
