from #calculate_$table.get("table") as a
where dst.date_id=a.date_id
and dst.AtmPort= a.AtmPort 
and dst.MGW= a.MGW 
and dst.OSS_ID= a.OSS_ID 
and dst.TransportNetwork= a.TransportNetwork 
and dst.VclTp= a.VclTp 
and dst.VpcTp= a.VpcTp 
and dst.VplTp= a.VplTp 
and dst.bhvalue=a.bhvalue;


drop table #calculate_$table.get("table");

#end



#foreach($table in $targetTableList.get("RANKBHCLASS"))

UPDATE $table.get("table") AS dst  
SET 
dst.bhclass = (dst.weekbh * 100) + (dst.weekbh * 10) + 1 
WHERE dst.date_id between $dateid and dateadd(dd,6,$dateid)
and dst.bhtype=''VCLTP_CP1'';

#end

set temporary option join_preference=''0''

', 'Y', 2, '', '', '', '');
